gnet = googlenet;ginputSize = gnet.Layers(1).InputSizeif isa(gnet,'SeriesNetwork')   gnetGraph = layerGraph(gnet.Layers); else  gnetGraph = layerGraph(gnet);end numClasses = 2;learnableLayer = gnetGraph.Layers(142,1);outputLayer = gnetGraph.Layers(144,1);if isa(learnableLayer,'nnet.cnn.layer.FullyConnectedLayer')    newLearnableLayer = fullyConnectedLayer(numClasses, ...        'Name','new_fc', ...        'WeightLearnRateFactor',10, ...        'BiasLearnRateFactor',10);    elseif isa(learnableLayer,'nnet.cnn.layer.Convolution2DLayer')    newLearnableLayer = convolution2dLayer(1,numClasses, ...        'Name','new_conv', ...        'WeightLearnRateFactor',10, ...        'BiasLearnRateFactor',10);endnewOutputLayer = classificationLayernewOutputLayer.Name='output';gnetGraph = replaceLayer(gnetGraph,learnableLayer.Name,newLearnableLayer);gnetGraph = replaceLayer(gnetGraph,outputLayer.Name,newOutputLayer);